-- ----------------------------
-- Table structure for t_course
-- ----------------------------
DROP TABLE IF EXISTS `t_course`;
CREATE TABLE `t_course` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(32) NOT NULL COMMENT '课程名称',
  `for_user` varchar(500) DEFAULT NULL COMMENT '适用人群',
  `course_type_id` bigint(32) NOT NULL COMMENT '课程分类',
  `grade_name` varchar(255) DEFAULT NULL,
  `grade_id` bigint(5) NOT NULL COMMENT '课程等级',
  `status` tinyint(32) DEFAULT NULL COMMENT '课程状态，下线：0 ， 上线：1',
  `login_id` bigint(32) DEFAULT NULL COMMENT '添加课程的后台用户的ID',
  `login_user_name` varchar(255) DEFAULT NULL COMMENT '添加课程的后台用户',
  `start_time` datetime DEFAULT NULL COMMENT '课程的开课时间',
  `end_time` datetime DEFAULT NULL COMMENT '课程的节课时间',
  `pic` varchar(255) DEFAULT NULL COMMENT '封面，云存储地址',
  `total_minute` int(11) DEFAULT NULL COMMENT '时长，以分钟为单位',
  `online_time` datetime DEFAULT NULL,
  `chapter_count` int(11) DEFAULT NULL COMMENT '章节数',
  `teacher_names` varchar(255) DEFAULT NULL COMMENT '讲师，逗号分隔多个',
  PRIMARY KEY (`id`),
  KEY `course_type_id` (`course_type_id`) USING BTREE,
  KEY `name` (`name`) USING BTREE,
  CONSTRAINT `t_course_ibfk_1` FOREIGN KEY (`course_type_id`) REFERENCES `t_course_type` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8;

