r\n<font face=\"宋体\"><font>、</font></font>\r\n<font face=\"宋体\"><font>0<font face=\"宋体\">基础但又想从事编程这个高薪职业的人；</font></font></font>\r\n<br>\r\n<font face=\"宋体\"><font>2、</font></font>\r\n<font face=\"宋体\"><font>Java<font face=\"宋体\">基础薄弱者（尤其是应届毕业生）又像从事</font>Java<font face=\"宋体\">开发的人；</font></font></font>\r\n<br>\r\n<font face=\"宋体\"><font>3、</font></font>\r\n<font face=\"宋体\"><font><font face=\"宋体\">准备考</font>Java<font face=\"宋体\">语言的计算机二级人员必备；</font></font></font>\r\n<br>\r\n<font face=\"宋体\"><font>4、</font></font>\r\n<font face=\"宋体\"><font>做了一段时间开发发现很多基础语法忘记的人；</font></font>\r\n<br>\r\n<font face=\"宋体\"><font>5</font><font face=\"宋体\"><font>、想要改变自己，获得高薪的人；<br><br><strong>课程目录</strong></font></font></font>\r\n<br>01、基础语法环境搭建\r\n<br>02、基础语法-数据类型\r\n<br>03、基础语法-运算符\r\n<br>04、基础语法-选择、循环结构\r\n<br>05、基础语法-方法、数组\r\n<br>06、基础语法-数组操作\r\n<br>\r\n<br>\r\n<img src=\"//10.url.cn/qqke_course_info/ajNVdqHZLLCXxKEiaOic3SibdpkzJaWbXJJt9d7nGoibkSLQDABiccdyohB0JT1XxMEfS0ahWa9wVRtY/\">\r\n<img src=\"//10.url.cn/qqke_course_info/ajNVdqHZLLDonVbWv4rI3xJvgQuZdeTPHibCf4H9A1CVZbXadJdJ3Tk1T89sWibf9DfkeVvm73t00/\">\r\n<img src=\"//10.url.cn/qqke_course_info/ajNVdqHZLLDT3RTEzPcBiceD98Y0VYXib6OQNV0rAvWNIylOUwOiacYw53X6ljDI2tV405MM5XWwhw/\">\r\n                        </div>');
INSERT INTO `t_course_detail` VALUES ('11', '这个一个牛逼的技术', '<div class=\"intro-course\">\r\n                            <strong><font><font face=\"宋体\"><font><font face=\"宋体\">视频简介</font></font></font></font></strong>\r\n<br>\r\n<font face=\"宋体\"><font>很庆幸你能够看到这份简介，因为那说明你对互联网对</font><font>IT</font><font>是感兴趣的，而这又恰好是一份</font><font>Java</font><font>的课程介绍。</font><font>Java</font><font>是目前也是二十年来一直稳居编程语言排行榜首位的开发语言，市场份额非常大、就业前景好、待遇高。</font></font>\r\n<br>\r\n<font face=\"宋体\"><font>本部分为整个课程的的基础语法部分，后续还会陆续更新更多的课程内容，为后期做</font><font>Java</font><font>企业级项目做铺垫，包括了：</font></font>\r\n<br>\r\n<font face=\"宋体\"><font>1、</font></font>\r\n<font face=\"宋体\"><font>Java<font face=\"宋体\">基础开发环境的搭建和基础语法</font>,<font face=\"宋体\">很多编程语言基础语法都类似，如果你有其它开发语言基础学起来会非常轻松；</font></font></font>\r\n<br>\r\n<font face=\"宋体\"><font>2、</font></font>\r\n<font face=\"宋体\"><font>Java<font face=\"宋体\">中面向对象编程语法和思想的培养；</font></font></font>\r\n<br>\r\n<br>\r\n<font face=\"宋体\"><font><font face=\"宋体\"><strong>主讲老师<br>胡昶晹&nbsp; </strong>高级讲师<strong>&nbsp;</strong></font></font></font>产品经理、项目经理\r\n<br>\r\n<font face=\"宋体\"><font><font face=\"宋体\">EasyJF开源团队成员，电子报特约撰稿人，曾任成都蓝源产品经理，对众多行业的业务需求有深入了解。负责需求分析、产品设计及推广工作；所设计的产品主要有：进销存流通行业，生产制造行业，服装、装饰企业ERP信息化建设、办公OA、CRM及各类网站建设；参与蓝源服装连锁ERP设计，装饰ERP设计，淘宝商城爱蜂潮企业ERP项目经理；对多家大中型企业做企业信息化管理培训，如天古集团、成发集团、淘宝商城爱蜂潮等。</font></font></font>\r\n<br>\r\n<br>\r\n<strong><font><font face=\"宋体\"><font><font face=\"宋体\">课程目标</font></font></font></font></strong>\r\n<br>\r\n<font face=\"宋体\"><font>本课程</font></font>\r\n<font face=\"宋体\"><font>重点培养以下几个点：</font></font>\r\n<br>\r\n<font face=\"宋体\"><font>1、</font></font>\r\n<font face=\"宋体\"><font>了解软件行业的发展与前景；</font></font>\r\n<br>\r\n<font face=\"宋体\"><font>2、</font></font>\r\n<font face=\"宋体\"><font><font face=\"宋体\">熟练</font>JavaSE<font face=\"宋体\">部分基础的语法知识；</font></font></font>\r\n<br>\r\n<br>\r\n<strong><font><font face=\"宋体\"><font><font face=\"宋体\">适合人群</font></font></font></font></strong>\r\n<br>\r\n<font face=\"宋体\"><font>1</font></font>\r\n<font face=\"宋体\"><font>、</font></font>\r\n<font face=\"宋体\"><font>0<font face=\"宋体\">基础但又想从事编程这个高薪职业的人；</font></font></font>\r\n<br>\r\n<font face=\"宋体\"><font>2、</font></font>\r\n<font face=\"宋体\"><font>Java<font face=\"宋体\">基础薄弱者（尤其是应届毕业生）又像从事</font>Java<font face=\"宋体\">开发的人；</font></font></font>\r\n<br>\r\n<font face=\"宋体\"><font>3、</font></font>\r\n<font face=\"宋体\"><font><font face=\"宋体\">准备考</font>Java<font face=\"宋体\">语言的计算机二级人员必备；</font></font></font>\r\n<br>\r\n<font face=\"宋体\"><font>4、</font></font>\r\n<font face=\"宋体\"><font>做了一段时间开发发现很多基础语法忘记的人；</font></font>\r\n<br>\r\n<font face=\"宋体\"><font>5</font><font face=\"宋体\"><font>、想要改变自己，获得高薪的人；<br><br><strong>课程目录</strong></font></font></font>\r\n<br>01、基础语法环境搭建\r\n<br>02、基础语法-数据类型\r\n<br>03、基础语法-运算符\r\n<br>04、基础语法-选择、循环结构\r\n<br>05、基础语法-方法、数组\r\n<br>06、基础语法-数组操作\r\n<br>\r\n<br>\r\n<img src=\"//10.url.cn/qqke_course_info/ajNVdqHZLLCXxKEiaOic3SibdpkzJaWbXJJt9d7nGoibkSLQDABiccdyohB0JT1XxMEfS0ahWa9wVRtY/\">\r\n<img src=\"//10.url.cn/qqke_course_info/ajNVdqHZLLDonVbWv4rI3xJvgQuZdeTPHibCf4H9A1CVZbXadJdJ3Tk1T89sWibf9DfkeVvm73t00/\">\r\n<img src=\"//10.url.cn/qqke_course_info/ajNVdqHZLLDT3RTEzPcBiceD98Y0VYXib6OQNV0rAvWNIylOUwOiacYw53X6ljDI2tV405MM5XWwhw/\">\r\n                        </div>');
