DROP TABLE IF EXISTS `t_course_market`;
CREATE TABLE `t_course_market` (
  `id` bigint(32) NOT NULL COMMENT '课程id',
  `charge` tinyint(32) NOT NULL DEFAULT '0' COMMENT '收费规则：，收费1免费，2收费',
  `qq` varchar(32) NOT NULL COMMENT '咨询qq',
  `price` decimal(18,2) NOT NULL COMMENT '价格',
  `price_old` decimal(18,2) DEFAULT NULL COMMENT '原价',
  `valid_days` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  CONSTRAINT `t_course_market_ibfk_1` FOREIGN KEY (`id`) REFERENCES `t_course` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

