DROP TABLE IF EXISTS `t_course_type`;
CREATE TABLE `t_course_type` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `create_time` bigint(20) DEFAULT NULL,
  `update_time` bigint(20) DEFAULT NULL,
  `name` varchar(50) DEFAULT '匿名' COMMENT '类型名',
  `pid` bigint(20) DEFAULT NULL COMMENT '父ID',
  `logo` varchar(150) DEFAULT NULL COMMENT '图标',
  `description` varchar(255) DEFAULT NULL COMMENT '描述',
  `sort_index` int(11) DEFAULT '100',
  `path` varchar(100) DEFAULT NULL COMMENT '路径',
  `total_count` int(20) DEFAULT '0' COMMENT '课程数量',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1050 DEFAULT CHARSET=utf8 COMMENT='课程目录';

