-- ----------------------------
-- Table structure for t_teacher
-- ----------------------------
DROP TABLE IF EXISTS `t_teacher`;
CREATE TABLE `t_teacher` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT NULL,
  `intro` varchar(255) DEFAULT NULL COMMENT '简介',
  `technology` varchar(255) DEFAULT NULL COMMENT '技术栈',
  `position` varchar(255) DEFAULT NULL COMMENT '职位，高级讲师，架构师',
  `head_img` varchar(255) DEFAULT NULL COMMENT '头像',
  `tags` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='老师表';

-- ----------------------------
-- Records of t_teacher
-- ----------------------------
INSERT INTO `t_teacher` VALUES ('1', '陈老师', '七年以上软件开发和教学经验，丰富的一线开发经验和管理经验，曾多次主导开发大型互联网金融项目，如开发了网贷之家平台上的多个p2p金融项目， 互联网电商项目，赢在青年理财投资平台，IT在线教育系统，基于Saas的CRM系统，大学生兼职APP等等', '擅长的技术有JavaSE,JavaWeb,Struts2,Spring,SpringMVC,MyBatis,Spring Boot,SpringCloud ,Docker,Jenkins,k8S,Redis，ElasticSearch,RabbitMQ,Nginx ，前段技术有 JavaScript,JQuery,EasyUI,BootStrap,VUE,ElementUI,Html,Css等等', '架构师', 'https://www.itsource.cn/upload/picasa/20201015/7a63cdf2-ebde-4dea-9b2a-c7c0d7b1afa8.png', '歌神,技术大牛');
INSERT INTO `t_teacher` VALUES ('2', '赵老师', '多年软件开发开作与项目管理经验，以及JavaEE应用开发。曾参与开发台湾超捷物流系统,淘宝商城爱蜂潮企业ERP，重庆天古装饰ERP，北京永泰地产流程设计等项目。并组织与研发重庆军方加油站警报系统，中国总经理网站后台,蓝源服饰Saas服务平台等系统。', '熟悉JavaEE底层技术与各种主流框架，如JavaWeb,Spring,Struts2等。 热衷于前端技术，对HTML5，CSS3，JQuery,BootStrap,ExtJS等技术都有深入的学习与研究。', '项目经理', 'https://www.itsource.cn/upload/picasa/20201015/99a45ff5-8300-42e0-b16c-cf70b185d465.png', '\r\n接地气儿，java指挥官');
